function FlightFile(props){
    let allFlights = props.scheduledFlights.map(flight => (
        <li>
            Upcoming Flight for {props.userFile.first_name} in aircraft {flight.aircraft_id}
            Scheduled Takeoff: {flight.scheduled_takeoff_timestamp} Scheduled Landing: {flight.scheduled_landing_timestamp}
            <button type="button" >Edit Flight Details</button>
        </li>
    ))
  
    return(
        <div>
            <h2>Scheduled Flights</h2>
            <ol>
                {allFlights}
            </ol>
        </div>
    )
}

export default FlightFile;
